- input: "TEXT\x1CC00162339\x1C.TEXT\x1C\x1CF3XA\x1CIn response to the RFAI issued
    3/27/14 on clarification of the Oxford Coomunication credits, the Ohio Republican
    Party uses Oxford Communications to assist in fundraising for both our state and
    federal party accounts.  All unpaid bills from Oxford were reported to the FEC
    as debt owed by the federal account.  After the bills were reported as debt it
    was determined that portions of these bills were for services performed for state
    fundraising activity and these were paid out of accounts associated with the state
    accounts.  The restricted account referenced in the memo text is a state account
    out of which the ORP can pay fundraising costs associated with fundraising for
    the state accounts.  A schedule H1 was added to this report.  Schedule H3 support
    of Line 18(A) was added to this report.  Schedule H4 supporting Line 21(a) was
    amended verifying that the employoees who were paid were not engaged in more than
    25% federal election activity.  The Boehner for Speaker transfer was moved from
    Line 11(C) to Line 12.\n"
